import 'package:json_annotation/json_annotation.dart';part 'loan_data_dto.g.dart';@JsonSerializable(ignoreUnannotated: false)class LoanDataDto {  @JsonKey(name: 'id')  final int? id;  @JsonKey(name: 'freelanceName')  final String? freelanceName;  @JsonKey(name: 'freelanceIcon')  final String? freelanceIcon;  @JsonKey(name: 'mobile')  final String? mobile;  @JsonKey(name: 'idNumber')  final String? idNumber;  @JsonKey(name: 'loanType')  final String? loanType;  @JsonKey(name: 'loanValue')  final double? loanValue;  @JsonKey(name: 'deductPercentage')  final String? deductPercentage;  @JsonKey(name: 'remainingLoan')  final double? remainingLoan;  LoanDataDto({this.id, this.freelanceName, this.freelanceIcon, this.mobile, this.idNumber, this.loanType, this.loanValue, this.deductPercentage, this.remainingLoan});  factory LoanDataDto.fromJson(Map<String, dynamic> json) => _$LoanDataDtoFromJson(json);  Map<String, dynamic> toJson() => _$LoanDataDtoToJson(this);}